#include <iostream>
#include <map>
#include <set>
#include <vector>

using namespace std;

class IterativeSolution {
 public:
    int lengthOfLongestSubstring(string s) {
        int cur_max = 0;
        for (int i = 0; i < s.length(); ++i) {
            int len = lengthStartingFrom(s, i);
            if (len > cur_max) {
                cur_max = len;
                if (i + cur_max > s.length()) {
                    return cur_max;
                }
            }
        }
        return cur_max;
    }

    int lengthStartingFrom(string s, int start) {
        std::set<char> occurrences;
        for (int i = start; i < s.length(); ++i) {
            // if s[i] already exists, a duplicate char is reached. halt.
            if (occurrences.find(s[i]) != occurrences.end()) {
                return i - 1 - start + 1;
            }
            occurrences.insert(s[i]);
        }
        // fix.
        return s.length() -1 - start + 1;
    }
};

class RecursiveSolution {
 public:
    int lengthOfLongestSubstring(string s) {
        if (s.length() == 1) {
            return 1;
        }
        int len_include_head = lengthStartingFromHead(s);
        int len_exclude_head = lengthOfLongestSubstring(s.substr(1));
        return len_include_head >= len_exclude_head ? len_include_head : len_exclude_head;
    }

    int lengthStartingFromHead(string s) {
        std::set<char> occurrences;
        for (int i = 0; i < s.length(); ++i) {
            // if s[i] already exists, return i -1;
            if (occurrences.find(s[i]) != occurrences.end()) {
                return i - 1 + 1;
            }
            occurrences.insert(s[i]);
        }
        return s.length();
    }
};

class Solution {
public:
    int lengthOfLongestSubstring(string s) {
        // Handle corner case.
        if (s.length() == 0)
            return 0;
        std::map<char, vector<int>> dic = createOccurrenceMap(s);
        // Try len in descending order.
        // TODO(xiangw): Find the upper bound of len to try.
        for (int len = s.length() ; len > 0; --len) {
            for (int i = 0; i + len - 1 < s.length(); ++i) {
               if (hasRepeatedChars(i, i + len - 1, dic)) {
                   continue;
               } else {
                   cout << "start: " << i << ", end: " << i + len - 1 << std::endl;
                   return len;
               }
            }
        }
        // Will not reach here.
        return 0;
    }

    std::map<char, vector<int>> createOccurrenceMap(const string& s) {
        std::map<char, vector<int>> dic;
        for (int i = 0; i < s.length(); ++i) {
            if (dic.find(s[i]) == dic.end()) {
                vector<int> occurrences;
                dic[s[i]] = occurrences;
            }
            dic[s[i]].push_back(i);
        }
        return dic;
    }
    
    bool hasRepeatedChars(int start, int end, std::map<char, vector<int>>& dic) {
        for (std::map<char, vector<int>>::iterator it = dic.begin(); it != dic.end(); ++it) {
            int num_of_occurrences = 0;
            for (const auto& pos : it->second) {
                if (pos >= start && pos <= end) {
                    num_of_occurrences++;
                    if (num_of_occurrences > 1) {
                        return true;
                    }
                }
                if (pos > end) {
                    if (num_of_occurrences <= 1) {
                        break;
                    }
                }
           }
        }
 
        return false;
    }
};

